import { Component, OnInit } from '@angular/core';
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { ModalController } from '@ionic/angular';
import { RendezVousData, getPatientsByMedUid, getConsultationsForPatient, medecinUid } from 'src/firebaseConfig';
import { FichePatientModalComponent } from './fiche-patient-modal/fiche-patient-modal.component';
import { ConsultationsModalComponent } from './consultations-modal/consultations-modal.component';
import { ConsultationslisteModalComponent } from '../patients/consultationsliste-modal/consultationsliste-modal.component';

interface consultationData {
  date: string;
  details?: string;
  uid?: string;
}

interface PatientData {
  id: string;
  nom: string;
  prenom: string;
  age?: number;
  adresse?: string;
  telephones?: string;
  uid?: string;
  medecinUid?: string; // Ajout de medecinUid dans PatientData
}

@Component({
  selector: 'app-affiche-patient',
  templateUrl: './patient.page.html',
  styleUrls: ['./patient.page.scss'],
})
export class PatientPage implements OnInit {
  patients: PatientData[] = [];
  rdvs: RendezVousData[] = [];
  uid: string = medecinUid.uid;
  nomPatient: string = ''; 
  prenomPatient: string = '';


  constructor(private firestore: AngularFirestore, private modalController: ModalController) { }

  ngOnInit() {
    this.getPatients();

  }

  async getPatients() {
    try {
      this.patients = await getPatientsByMedUid(this.firestore, this.uid);
      if (this.patients.length > 0) {
        this.nomPatient = this.patients[0].nom;
        this.prenomPatient = this.patients[0].prenom;
      } 
      console.log("Patients trouvés :", this.patients);
    } catch (error) {
      console.error('Erreur lors de la récupération des patients :', error);
    }
  }

  async openFichePatientModal(patient: PatientData) {
    const modal = await this.modalController.create({
      component: FichePatientModalComponent,
      componentProps: {
        patientData: patient,
        medecinUid: this.uid // Passer l'UID du médecin ici
      }
    });

    modal.onDidDismiss().then((data) => {
      if (data && data.data) {
        console.log('Données de la fiche patient à enregistrer :', data.data);
      }
    });

    return await modal.present();
  }

  async showConsultations() {
    const modal = await this.modalController.create({
      component: ConsultationsModalComponent,
    });
    await modal.present();
  }

  async openConsultationsListeModal(patient: PatientData) {
    try {
      // Récupérer les consultations du patient en utilisant son UID
      const consultations = await getConsultationsForPatient(this.firestore, medecinUid.uid, patient.id);

      const modal = await this.modalController.create({
        component: ConsultationslisteModalComponent,
        componentProps: {
          consultationsData: consultations,
          medecinUid: this.uid // Passer l'UID du médecin ici
        }
      });

      await modal.present();
    } catch (error) {
      console.error('Erreur lors de l\'ouverture du modal de la liste des consultations :', error);
    }
  }
med=this.uid;
n=this.nomPatient ;
p=this.prenomPatient;


}
export let med :string ;
export let n :string ;
export let p :string ;

<ion-header>
  <ion-toolbar>
    <ion-title>Liste des Patients</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content>
  <ion-list>
    <ion-grid>
      <ion-row>
        <ion-col size="2"><strong>Nom</strong></ion-col>
        <ion-col size="2"><strong>Prénom</strong></ion-col>
        <ion-col size="2"><strong>Age</strong></ion-col>
        <ion-col size="3"><strong>Adresse</strong></ion-col>
        <ion-col size="2"><strong>Téléphone</strong></ion-col>
        <ion-col size="3"><strong>Actions</strong></ion-col>
      </ion-row>
      <ion-row *ngFor="let patient of patients">
        <ion-col size="2">{{ patient.nom }}</ion-col>
        <ion-col size="2">{{ patient.prenom }}</ion-col>
        <ion-col size="2">{{ patient.age }}</ion-col>
        <ion-col size="3">{{ patient.adresse }}</ion-col>
        <ion-col size="2">{{ patient.telephones }}</ion-col>
        <ion-col size="3">
          <ion-button (click)="openFichePatientModal(patient)" color="primary">Fiche Patient</ion-button>
          <ion-button  (click)="openConsultationsListeModal(patient)" color="primary">
          </ion-button>
        </ion-col>
      </ion-row>
    </ion-grid>
  </ion-list>
</ion-content>
